import React, { Component } from 'react';
import logo from '../../logo.svg';
import '../css/App.css';
import PropTypes from 'prop-types'


const App = (props) => (
  <div className='App'>
    <button type="button"
        onClick={() => props.playSong()}  >
          {props.playing ? 'Pause' : 'Play'}
    </button>
  </div>
);

App.propTypes = {
  playing: PropTypes.bool.isRequired,
  songName: PropTypes.string,
}

export default App;
